import React from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.css";
import NavComp from "./components/nav";
import DebtComp from "./components/debt";
import BillsComp from "./components/bills";
import CalendarComp from "./components/calendar";

// Fake Data
import jsonDebtResponse from "./components/debtData";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h3>Budgetizer 1.0</h3>
        <NavComp />
      </header>
      <main className="container">
        <div className="row">
          <div className="col-sm">
            <div className="card card-custom">
              <h6>Debt</h6>
              <p>List of totals owed and to whom.</p>
            </div>
          </div>
          <div className="col-sm">
            <div className="card card-custom">
              <h6>Bills</h6>
              <p>Min amt due and when on each of your monthly bills.</p>
            </div>
          </div>
          <div className="col-sm">
            <div className="card card-custom">
              <h6>Calendar</h6>
              <p>When you get paid and make payments.</p>
            </div>
          </div>
        </div>
      </main>
      <footer>
        <p>footer</p>
      </footer>
    </div>
  );
}

export default App;
